import "./program.scss";

const Program = () => {
  const test = () => {
    let temp = '';
    let str = '*'

    for(let i = 0; i < 9; i++) {
      temp += str.repeat(i+1) + '\n' 
    }

    return temp
  }

  return (
    <div>
      { test() }
    </div>
  )
};

export default Program;
